import React, { useEffect, useState } from 'react';
import JobCard from './JobCard';
import { CircularProgress, Typography, Box, TextField, MenuItem, Chip, Fade, Stack, InputAdornment } from '@mui/material';
import SearchIcon from '@mui/icons-material/Search';
import axios from 'axios';

const EMPLOYMENT_TYPES = [
  { value: '', label: 'All Types' },
  { value: 'full_time', label: 'Full Time' },
  { value: 'part_time', label: 'Part Time' },
  { value: 'contract', label: 'Contract' },
  { value: 'internship', label: 'Internship' },
  { value: 'temporary', label: 'Temporary' },
  { value: 'remote', label: 'Remote' },
  { value: 'other', label: 'Other' },
];

function JobList() {
  const [jobs, setJobs] = useState([]);
  const [filtered, setFiltered] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [search, setSearch] = useState('');
  const [type, setType] = useState('');
  const [categories, setCategories] = useState([]);
  const [selectedCategory, setSelectedCategory] = useState('');

  useEffect(() => {
    axios.get('/api/jobs/?is_active=true&ordering=-posted_at')
      .then(res => {
        setJobs(res.data);
        setLoading(false);
        // Collect unique categories
        const cats = Array.from(new Set(res.data.map(j => j.category).filter(Boolean)));
        setCategories(cats);
      })
      .catch(() => {
        setError('Failed to load jobs.');
        setLoading(false);
      });
  }, []);

  useEffect(() => {
    let filteredJobs = jobs;
    if (type) filteredJobs = filteredJobs.filter(j => j.employment_type === type);
    if (selectedCategory) filteredJobs = filteredJobs.filter(j => j.category === selectedCategory);
    if (search) {
      const s = search.toLowerCase();
      filteredJobs = filteredJobs.filter(j =>
        j.title.toLowerCase().includes(s) ||
        j.company.toLowerCase().includes(s) ||
        j.location.toLowerCase().includes(s) ||
        (j.description && j.description.toLowerCase().includes(s))
      );
    }
    setFiltered(filteredJobs);
  }, [jobs, type, selectedCategory, search]);

  if (loading) return <CircularProgress sx={{ mt: 4 }} />;
  if (error) return <Typography color="error">{error}</Typography>;

  return (
    <Box>
      <Stack direction={{ xs: 'column', sm: 'row' }} spacing={2} mb={3} alignItems="center">
        <TextField
          label="Search jobs"
          variant="outlined"
          size="small"
          value={search}
          onChange={e => setSearch(e.target.value)}
          InputProps={{
            startAdornment: (
              <InputAdornment position="start">
                <SearchIcon />
              </InputAdornment>
            ),
          }}
          sx={{ minWidth: 200, bgcolor: 'background.paper', borderRadius: 2 }}
        />
        <TextField
          select
          label="Type"
          value={type}
          onChange={e => setType(e.target.value)}
          size="small"
          sx={{ minWidth: 140, bgcolor: 'background.paper', borderRadius: 2 }}
        >
          {EMPLOYMENT_TYPES.map(opt => (
            <MenuItem key={opt.value} value={opt.value}>{opt.label}</MenuItem>
          ))}
        </TextField>
        <Box>
          {categories.map(cat => (
            <Chip
              key={cat}
              label={cat}
              color={selectedCategory === cat ? 'secondary' : 'default'}
              onClick={() => setSelectedCategory(selectedCategory === cat ? '' : cat)}
              sx={{ mr: 1, mb: { xs: 1, sm: 0 }, fontWeight: 600 }}
              clickable
            />
          ))}
        </Box>
      </Stack>
      {filtered.length === 0 ? (
        <Typography>No jobs found.</Typography>
      ) : (
        <Box>
          {filtered.map(job => (
            <Fade in key={job.id} timeout={500}>
              <div>
                <JobCard job={job} />
              </div>
            </Fade>
          ))}
        </Box>
      )}
    </Box>
  );
}

export default JobList;
